import React, { useState } from 'react';
import './login.css';
const LoginForm = () => {
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');

    const handleSubmit = (e) => {
        e.preventDefault();
        // Ici, vous pouvez appeler votre service d'authentification
        console.log('Username:', username, 'Password:', password);
    };

    return (
        <div className="login-container">
             <img src={require('../photos/winnercoloresvg.svg').default} alt="Description de l'image" className='login-img' />
            <div className="form-container">
                <h2>Connexion Administrateur</h2>
                <form onSubmit={handleSubmit} className='logf'>
                    <input type="text" id="username" name="username" value={username} onChange={(e) => setUsername(e.target.value)} required placeholder='Username :' />
                    <input type="password" id="password" name="password" value={password} onChange={(e) => setPassword(e.target.value)} required/>
                    <button type="submit">Se connecter</button>
            </form>
            </div>
        </div>
    );
};

export default LoginForm;
